import React from "react";
import Button from '@material-ui/core/Button';

const Form = props =>(

			<form onSubmit={props.getWeather} >
				<input type="text" name="city"/>
				<input type="text" name="country"/>
				<button> Search </button>

			</form>
			);

export default Form;
